(193, 'Setiap orang punya waktu nya masing2..\n2012 gw kabur dari Rumah \nDengan bawa ideologi gw yg bertentangan sama ortu gw\nNinggalin semua yg gw punya..\nGw tinggalin gengsi gw,harta dll\nGw hidup sendiri.. di tipu orang , kerja jadi SPB , kerja di pom bensin , bersihin mobil orang.. makan sehari sekali .. di usir dari kos karna ga bayar.. tidur di gudang.. 4 tahun gw hidup sendiri tanpa sekalipun gw minta uang sepeserpun sama ortu gw.. karna gengsi juga.. anak cowo kabur dari rumah masih minta duit itu galogis menurut gw.. singkat cerita gw ingin memulai sesuatu.. jadi youtuber.. di tahun 2016.. dan itu berat banget.. penolakan dari orang terdekat yg terutama\nDi bilang "sok ngartis" "orang gila"\nUdah jadi makanan sehari2 gw.. \nTapi merasa tertolak buat mental gw kuat dan gw jadi makin semangat buat ngebuktiin ke orang2 itu kalo gw bisa.. penolakan kadang buat lu jadi down dan hilang semangat.. tapi ini pesen gw sebagai orang yg sama kaya kalian di luar sana yg masih merintis dan tertolak.. "lakuin aja apa yg kalian suka selama ga ngerugiin orang dan bisa MENGHASILKAN tanpa peduli apa kata orang lain"\nDulu orang2 bilang gw "sok ngartis" "gila ngomong sama kamera" dll.. \nSekarang mereka ngomong2 begitu gw mah nyimak aja sambil gadoin steak di Tony Romas \nJadi inti nya.. Lakuin dulu aja bro.. gagal biasa.. usaha gabakal ngehianatin hasil.. apa kata orang gausah peduliin.\nBtw kenalin ini jeffry .. Mobil baru gw.. *cheers', 'tiap orang punya waktu masing    gw kabur rumah  bawa ideologi gw sama ortu gw ninggalin semua gw punya   gw tinggalin gengsi gw harta gw hidup sendiri   tipu orang   kerja jadi spb   kerja pom bensin   bersihin mobil orang   makan hari sekali    usir kos karna bayar   tidur gudang    tahun gw hidup sendiri sekalipun gw minta uang peser sama ortu gw   karna gengsi   anak cowo kabur rumah minta duit galogis turut gw   singkat cerita gw mulai   jadi youtuber   tahun    berat banget   tolak orang dekat utama bilang  sok ngartis   orang gila  jadi makan hari gw    rasa tolak buat mental gw kuat gw jadi makin semangat buat ngebuktiin orang gw   tolak kadang buat jadi down hilang semangat   sen gw bagai orang sama kaya kalian luar sana rintis tolak    lakuin kalian suka lama ngerugiin orang hasil peduli kata orang  orang bilang gw  sok ngartis   gila ngomong sama kamera     sekarang ngomong gw mah nyimak gadoin steak tony romas  jadi inti   lakuin bro   gagal biasa   usaha gabakal ngehianatin hasil   kata orang gausah peduliin  btw kenalin jeffry    mobil baru gw    cheers', 0),
