(758, 'ROHINGYA dan ZAMAN RASULULLAH\n\nPenampakan sadistis zaman modern d miyanmar itu menjadi gambaran nyata tentang umat Islam pada zaman jahiliyah Quraisy. zaman dimana umat Islam menjadi minoritas, zaman Islam masih awal dibangun. Zaman dimana kaum penyembah tuhan berwujud berhala melakukan tindakan penistaan atau pelecehan kemanusian\nKebiadaban yang dialami oleh Rohingya adalah satu resiko pilihan Iman. Satu pilihan sebagai minoritas yang segalanya bisa terjadi. Bisa aman atau sebaliknya penuh penindasan, penolakan bahkan sampai pada tindalan keji tak bermoral dan penuh kebiadaban. Jalan satu satunya bagi Rohingya hanyalah menjadi Kaum Muhajirin, melakukan Hijrah, mencari sodaranya Anshor di negeri seberang.\n\nKaum Anshor adalah kaum penolong bagi kaum Muhajirin yang sedang ditimpa kemalangan tindakan keji dan biadab oleh antek Quraissy pimpinan Abu Jahal. Pembunuhan, penyiksaan, tanpa ampun dan belas kasihan. Semua menjadi korban pembinasaan, apakah itu wanita, orang tua, pemuda bahkan bocah bocah. Hanya Anshor yang dengan suka cita menyambut Muhajirin.\n\nKita, bisa berperan menjadi Anshor atau yang lain. Tinggal seberapa peduli kita merasakan batapa biadap tindakan Barbar kaum Jahiliyyah Budha Miyanmar terhadap Muslim Rohingya. Bukan hanya soal Agama, melainkan PERIKEMANUSIAAN dan PERIKEADILAN...YANG BERADAB.', 'rohingya zaman rasulullah  tampak sadistis zaman modern d miyanmar jadi gambar nyata umat islam zaman jahiliyah quraisy  zaman umat islam jadi minoritas  zaman islam awal bangun  zaman kaum sembah tuhan wujud berhala laku tindak nista leceh kemanusian biadab alami rohingya satu resiko pilih iman  satu pilih bagai minoritas segala jadi  aman balik penuh tindas  tolak bahkan tindalan keji moral penuh biadab  jalan satu satu rohingya jadi kaum muhajirin  laku hijrah  cari sodaranya anshor negeri seberang   kaum anshor kaum kaum muhajirin sedang timpa malang tindak keji biadab antek quraissy pimpin abu jahal  bunuh  siksa  ampun belas kasihan  semua jadi korban binasa  wanita  orang tua  pemuda bahkan bocah bocah  anshor suka cita sambut muhajirin    peran jadi anshor  tinggal berapa peduli rasa batapa biadap tindak barbar kaum jahiliyyah budha miyanmar hadap muslim rohingya  soal agama  perikemanusiaan perikeadilan   adab', 1),
