(1072, 'Kehidupan Suku Dayak ini memang sudah lama mencuri banyak perhatian dunia.\nVedio langka dan jadul potret kehidupan Suku Dayak di Borneo, keren!\nKalimantan adalah pulau terbesar ketiga di dunia. Sebelum terkenal dengan nama Kalimantan, sebelumnya pulau ini lebih terkenal dengan nama Borneo. Borneo memiliki banyak cerita, juga tentang Suku Dayak yang tinggal di sana.\n\nKehidupan Suku Dayak memang mencuri banyak perhatian dunia luas. Beberapa peneliti dari luar negeri secara khusus pernah datang ke Borneo untuk meneliti suku ini. Salah satunya adalah George Muller yang melakukan ekspedisi dari Mahakam ke Kapuas.\n\nNah, soal kehidupan Suku Dayak sendiri. Gansis, momod & mimin pasti terpesona dengan vedio ini di bikin pd tahun 1949', 'hidup suku dayak memang lama curi banyak perhati dunia  vedio langka jadul potret hidup suku dayak borneo  keren  kalimantan pulau besar tiga dunia  kenal nama kalimantan  pulau lebih kenal nama borneo  borneo milik banyak cerita  suku dayak tinggal sana   hidup suku dayak memang curi banyak perhati dunia luas  beberapa teliti luar negeri cara khusus pernah datang borneo teliti suku  salah satu george muller laku ekspedisi mahakam kapuas    soal hidup suku dayak sendiri  gansis  momod   mimin pesona vedio bikin pd tahun', 0),
