(1168, 'ANGKA KEMISKINAN DI INDONESIA TURUN MENJADI SINGLE DIGIT DI ANGKA 9.8%, KOK BISA?\n\nTernyata, hal ini dipengaruhi oleh salah satu Program Unggulan Jokowi dalam rangka menurunkan Kemiskinan, yakni PKH (Program Keluarga Harapan). Program ini bahkan mendapat apresiasi dari Country Director Bank Dunia Rodrigo A. Chaves karena program tersebut telah berhasil menekan angka kemiskinan di Indonesia.\n\nPemerintahan Jokowi-JK secara serius merancang strategi pengurangan kemiskinan dan ketimpangan sosial dengan cara :\n1. Program bantuan sosial tunai meningkat sampai 87,6 persen\n2. Penambahan jumlah keluarga KPM.\n3. PKH telah disalurkan tepat waktu sebanyak 98,7 persen \nSingkatnya :\nKPM PKH diperbanyak -> Anggaran dinaikkan -> Pencairan tepat waktu -> Angka kemiskinan turun\n\nMakin optimis dong untuk Indonesia Maju. Kuy dukung pemerintah dalam mengentaskan kemiskinan di Indonesia', 'angka miskin indonesia turun jadi single digit angka       nyata  pengaruh salah satu program unggul jokowi rangka turun miskin  pkh  program keluarga harap   program bahkan apresiasi country director bank dunia rodrigo a  chaves program sebut hasil tekan angka miskin indonesia   perintah jokowi jk cara serius rancang strategi kurang miskin timpang sosial cara     program bantu sosial tunai tingkat   persen   tambah jumlah keluarga kpm    pkh salur tepat waktu banyak   persen  singkat   kpm pkh banyak    anggar naik    cair tepat waktu    angka miskin turun  makin optimis dong indonesia maju  kuy dukung perintah entas miskin indonesia', 0),
