(1314, 'Daerah Sunda (Jawa Barat) adalah kerajaan besar pertama yang ada di tanah Jawa, salah satu yang pertama di Indonesia dan Asia Tenggara.\n\nPada jaman kerajaan Tarumanegara, 3 abad sebelum Islam dan Nabi Muhammad lahir, orang Sunda sudah memeluk agama Hindu, sedikit Buddha, dan lainnya animisme.\n\nKalau sekarang orang Sunda itu yang paling religius se Jawa atau bahkan se Indonesia, bahkan punya gubernur PKS, mungkin karena orang Sunda suka yang ekstrim-ekstrim. Kalau Hindu ekstrim Hindunya karena masih bergaya India, beda dengan Majapahit yang sudah dicampur dengan animisme dan Buddha, kalau Islam pun ekstrim Islamnya, selain punya gubernur PKS, negara Islam Indonesia pun dikobarkan dari tanah Sunda.\n\nDalam banyak hal orang Sunda juga ektrim, ceweknya ekstrim cantik, kalau kawin ekstrim muda, orangnya ekstrim sopan, kalau mabuk pun ekstrim sampai ratusan yang mati :D', 'daerah sunda  jawa barat  raja besar pertama tanah jawa  salah satu pertama indonesia asia tenggara   jaman raja tarumanegara   abad islam nabi muhammad lahir  orang sunda peluk agama hindu  sedikit buddha  animisme   sekarang orang sunda paling religius se jawa bahkan se indonesia  bahkan punya gubernur pks  mungkin orang sunda suka ekstrim ekstrim  hindu ekstrim hindu gaya india  beda majapahit campur animisme buddha  islam ekstrim islam  punya gubernur pks  negara islam indonesia kobar tanah sunda   banyak orang sunda ektrim  cewek ekstrim cantik  kawin ekstrim muda  orang ekstrim sopan  mabuk ekstrim ratus mati  d', 0),
