(1368, 'Kereta Api Keparat: Ada seorang pemuda di daerah antah berantah sana, kebetulan sedang nonton film di bioskop di daerahnya. Salah satu adegan di film itu adalah seorang gadis bahenol yang sedang berusaha membuka bajunya, setelah itu dilanjutkan dengan membuka kaos dalamnya.\n\nDan akhirnya tibalah pada adegan dimana gadis itu harus membuka juga seluruhnya. Namun sebelum gadis itu berhasil, tiba-tiba ada Kereta Api yang lewat dan menutupi si gadis. Setelah kereta api berlalu si gadis ternyata sudah berpakaian lengkap kembali.\n\nKecewalah ucok, setelah beberapa saat sempat menahan dentuman jantungnya. Esoknya, si Ucok datang lagi, beli karcis lagi, nonton lagi film yg sama. Dan kecewa lagi. Tanpa kenal kata menyerah, esoknya pun dia masih nonton lagi sampai beberapa hari.\n\nTukang karcis penasaran melihat hal ini, maka bertanyalah ia. "Hey Lay .. Kalo tidak salah, sudah kau tonton pilem ini berkali-kali? Kenapa masih datang juga?" Si Ucok menjawab, "Ah benar kali itu bang, tapi aku yakin bang, suatu saat, kereta api keparat itu pastilah terlambat."', 'kereta api keparat  orang pemuda daerah antah antah sana  betul sedang nonton film bioskop daerah  salah satu adegan film orang gadis bahenol sedang usaha buka baju  lanjut buka kaos   akhir tiba adegan gadis buka seluruh  gadis hasil  tiba tiba kereta api lewat tutup gadis  kereta api lalu gadis nyata pakai lengkap   kecewa ucok  beberapa sempat tahan dentum jantung  esok  ucok datang  beli karcis  nonton film  kecewa  kenal kata serah  esok nonton beberapa hari   tukang karcis penasaran lihat  tanya   hey lay    salah  kau tonton pilem kal kali  datang   ucok jawab   ah benar kali bang  yakin bang  suatu  kereta api keparat lambat', 0),
(1370, 'Jika semua orang baik, lalu untuk apa tuhan menciptakan neraka?\nAda kalanya yang jahat seperti bangsat dan keparat ber-plagiat lagaknya sok baik sok asik nyatanya munafik yang samar seperti kirik !\nEnyahlah kau wahai bajingan tengik !', 'semua orang baik  lalu tuhan cipta neraka  kala jahat bangsat keparat ber plagiat lagak sok baik sok asik nyata munafik samar kirik   enyah kau wahai bajing tengik', 0),
